import React, { Component } from "react";
import CardFood from "./CardFood";

class Food extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div style={{ paddingTop: "1rem" }}>
        <CardFood slide="1" />
        <CardFood slide="2" />
      </div>
    );
  }
}
export default Food;
